var suggestions=document.getElementById('suggestions'),search=document.getElementById('search');search!==null&&document.addEventListener('keydown',inputFocus);function inputFocus(a){a.ctrlKey&&a.key==='/'&&(a.preventDefault(),search.focus()),a.key==='Escape'&&(search.blur(),suggestions.classList.add('d-none'))}document.addEventListener('click',function(a){var b=suggestions.contains(a.target);b||suggestions.classList.add('d-none')}),document.addEventListener('keydown',suggestionFocus);function suggestionFocus(b){const d=suggestions.querySelectorAll('a'),e=[...d],a=e.indexOf(document.activeElement),f=suggestions.classList.contains('d-none');let c=0;b.keyCode===38&&!f?(b.preventDefault(),c=a>0?a-1:0,d[c].focus()):b.keyCode===40&&!f&&(b.preventDefault(),c=a+1<e.length?a+1:a,d[c].focus())}(function(){var a=new FlexSearch.Document({tokenize:"forward",cache:100,document:{id:'id',store:["href","title","description"],index:["title","description","content"]}});a.add({id:0,href:"/docs/prologue/introduction/",title:"Introduction",description:"This introduction helps you to to get started and shows you how to join our community.",content:'\u003cp\u003eMatrix is an open-source project that publishes the Matrix open standard for\nsecure, decentralized, real-time communication, and its Apache licensed\nreference implementations.\u003c/p\u003e\n\u003cp\u003eMaintained by the non-profit Matrix.org Foundation, they aim to create an open\nplatform which is as independent, vibrant and evolving as the Web itself\u0026hellip;\nbut for communication.\u003c/p\u003e\n\u003cp\u003eAs of June 2019, Matrix is out of beta, and the protocol is fully suitable\nfor production usage.\u003c/p\u003e\n\u003cp\u003eSince then, Matrix evolved quite a bit, with plenty of features suitable for\nbuilding a large community like ours.\u003c/p\u003e\n\u003cp\u003eFor example:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003e\u003cstrong\u003eEdit\u003c/strong\u003e your \u003cstrong\u003emessages\u003c/strong\u003e when, and how often you want\u003c/li\u003e\n\u003cli\u003eUse the \u003cstrong\u003eMarkdown\u003c/strong\u003e markup language to format your messages\u003c/li\u003e\n\u003cli\u003eMake your code visually attractive with the built-in \u003cstrong\u003esyntax highlighting\u003c/strong\u003e.\nIf you have many lines of code, the code block becomes collapsed down to 15\nlines and is scrollable and expandable.\u003c/li\u003e\n\u003cli\u003eLet everyone know what message you are referring to with\n\u003cstrong\u003emessage reply\u0026rsquo;s\u003c/strong\u003e or just use the users nickname as reference.\u003c/li\u003e\n\u003cli\u003eCommunicate with other users in private\u003c/li\u003e\n\u003cli\u003eUse $ \\textbf{\\LaTeX} $ \u003cstrong\u003emath\u003c/strong\u003e to get textbook like math\u003c/li\u003e\n\u003cli\u003eSend images or videos\u003c/li\u003e\n\u003cli\u003eAdd non-disturbing Emoji reactions to messages\u003c/li\u003e\n\u003cli\u003eAvatars help you recognize other users\u003c/li\u003e\n\u003cli\u003eWork with the client on the operating system you prefer(even on the Nintendo 3DS if you like 😁)\u003c/li\u003e\n\u003cli\u003eQuote or forward messages\u003c/li\u003e\n\u003cli\u003e\u0026hellip; and many more features\u003c/li\u003e\n\u003c/ul\u003e\n\u003cp\u003eOur community does not focus on specific features of the Python language or\necosystem. We like to provide simple access for discussions and immediate\nhelp with programming questions. In addition, we provide a platform for\nsuggestions and proposals, as well as off-topic conversations.\u003c/p\u003e\n\u003cp\u003eBefore you can start, make sure you have read our\n\u003ca href="https://matrix-python.github.io/docs/contributing/code_of_conduct/"\u003eCode of Conduct\u003c/a\u003e.\u003c/p\u003e\n\u003ch2 id="quick-start"\u003eQuick Start\u003c/h2\u003e\n\u003cp\u003eYou are already on Matrix and you want to start quick? Check out our one page\nsummary of how to join our community. \u003ca href="https://matrix-python.github.io/docs/prologue/quick-start/"\u003eQuick Start →\u003c/a\u003e\u003c/p\u003e\n\u003ch2 id="tutorial"\u003eTutorial\u003c/h2\u003e\n\u003cp\u003eYou are new to Matrix or Element or you want to know more about the\nfeatures? Follow our Step-by-step tutorial and join our community.\n\u003ca href="https://matrix-python.github.io/docs/tutorial/about_this_tutorial/"\u003eTutorial →\u003c/a\u003e\u003c/p\u003e\n\u003cdiv class="alert alert-warning d-flex" role="alert"\u003e\r\n  \u003cdiv class="flex-shrink-1 alert-icon"\u003e⚠ \u003c/div\u003e\r\n  \r\n    \u003cdiv class="w-100"\u003eThis tutorial focuses on Element as client for Matrix. There are many more Clients available. If you want to use another client, make sure to check out the client\'s documentation. \u003c/div\u003e\r\n  \r\n\u003c/div\u003e\r\n\n\u003ch2 id="help"\u003eHelp\u003c/h2\u003e\n\u003cp\u003eIf you find yourself in a situation, where you need help, check out the Help\nsection.\u003c/p\u003e\n\u003cp\u003eHelp upgrading Element? \u003ca href="https://matrix-python.github.io/docs/help/how-to-update/"\u003eHow to update Element →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003eYou have problems joining the community? \u003ca href="https://matrix-python.github.io/docs/help/troubleshooting/"\u003eTroubleshooting →\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003eThere are questions left? \u003ca href="https://matrix-python.github.io/docs/help/faq/"\u003eFAQ →\u003c/a\u003e\u003c/p\u003e\n'}).add({id:1,href:"/docs/prologue/quick-start/",title:"Quick Start",description:"",content:'\u003cp\u003eIf you join our (optional) community Space\n\u003ca href="https://matrix.to/#/#python-community:matrix.org" target="_blank"\u003e\u003ccode\u003e#python-community:matrix.org\u003c/code\u003e\u003c/a\u003e,\nyou will find the following rooms:\u003c/p\u003e\n\u003cp\u003eIn the Space you will find two new rooms:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003e\u003cstrong\u003ePython\u003c/strong\u003e room \u0026ndash; for everything python :\n\u003ca href="https://matrix.to/#/#python:matrix.org" target="_blank"\u003e\n\u003ccode\u003e#python:matrix.org\u003c/code\u003e\n\u003c/a\u003e\u003c/li\u003e\n\u003cli\u003e\u003cstrong\u003eMeta\u003c/strong\u003e room \u0026ndash; for organizational questions, suggestions \u0026amp; proposals :\n\u003ca href="https://matrix.to/#/#python-meta:matrix.org" target="_blank"\u003e\n\u003ccode\u003e#python-meta:matrix.org\u003c/code\u003e\n\u003c/a\u003e\u003c/li\u003e\n\u003cli\u003e\u003cstrong\u003eOfftopic\u003c/strong\u003e room \u0026ndash; for everything off-topic:\n\u003ca href="https://matrix.to/#/#python-off-topic:matrix.org" target="_blank"\u003e\n\u003ccode\u003e#python-off-topic:matrix.org\u003c/code\u003e\n\u003c/a\u003e\u003c/li\u003e\n\u003c/ul\u003e\n'}).add({id:2,href:"/docs/contributing/code_of_conduct/",title:"Code of Conduct",description:"",content:'\u003cp\u003eThis code of conduct outlines our expectations for participants within the\nMatrix community, as well as steps for reporting unacceptable behaviour.\nWe are committed to providing a welcoming and inspiring community for all,\nand expect our code of conduct to be honoured. Anyone who violates this code\nof conduct may be banned from the community.\u003c/p\u003e\n\u003cp\u003eThis applies to communication in any room of the Python community Matrix Space\n\u003ccode\u003e#python-community:matrix.org\u003c/code\u003e and commits and comments relating to any\nproject in the \u003ccode\u003ematrix-python\u003c/code\u003e GitHub space.\u003c/p\u003e\n\u003cp\u003eOur open source community strives to:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003e\u003cstrong\u003eBe friendly and patient\u003c/strong\u003e.\u003c/li\u003e\n\u003cli\u003e\u003cstrong\u003eBe welcoming\u003c/strong\u003e: We strive to be a community that welcomes and supports\npeople of all backgrounds and identities. This includes, but is not\nlimited to members of any race, ethnicity, culture, national origin,\ncolour, immigration status, social and economic class, educational level,\nsex, sexual orientation, gender identity and expression, age, size, family\nstatus, political belief, religion, and mental and physical ability.\u003c/li\u003e\n\u003cli\u003e\u003cstrong\u003eBe considerate\u003c/strong\u003e: Your work will be used by other people, and you in\nturn will depend on the work of others. Any decision you take will\naffect users and colleagues, and you should take those consequences into\naccount when making decisions. Remember that we\u0026rsquo;re a world-wide community,\nso you might not be communicating in someone else\u0026rsquo;s primary language.\u003c/li\u003e\n\u003cli\u003e\u003cstrong\u003eBe respectful\u003c/strong\u003e: Not all of us will agree all the time, but disagreement\nis no excuse for poor behaviour and poor manners. We might all experience\nsome frustration now and then, but we cannot allow that frustration to turn\ninto a personal attack. It’s important to remember that a community where\npeople feel uncomfortable or threatened is not a productive one.\u003c/li\u003e\n\u003cli\u003e\u003cstrong\u003eBe careful in the words that we choose\u003c/strong\u003e: Be kind to others. Do not insult\nor put down other participants. Harassment and other exclusionary behaviour\naren\u0026rsquo;t acceptable.\u003c/li\u003e\n\u003cli\u003e\u003cstrong\u003eTry to understand why we disagree\u003c/strong\u003e: Disagreements, both social and\ntechnical, happen all the time. It is important that we resolve disagreements\nand differing views constructively. Remember that we’re different. The\nstrength of our community comes from its diversity, people from a wide range\nof backgrounds. Different people have different perspectives on issues. Being\nunable to understand why someone holds a viewpoint doesn’t mean that they’re\nwrong . Don’t forget that it is human to err and blaming each other doesn’t\nget us anywhere. Instead, focus on helping to resolve issues and learning\nfrom mistakes.\u003c/li\u003e\n\u003c/ul\u003e\n\u003ch2 id="definitions"\u003eDefinitions\u003c/h2\u003e\n\u003cp\u003eHarassment includes, but is not limited to:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003eOffensive comments related to gender, gender identity and expression, sexual\norientation, disability, mental illness, neuro(a)typicality, physical\nappearance, body size, race, age, regional discrimination, political or\nreligious affiliation\u003c/li\u003e\n\u003cli\u003eUnwelcome comments regarding a person’s lifestyle choices and practices,\nincluding those related to food, health, parenting, drugs, and employment\u003c/li\u003e\n\u003cli\u003eDeliberate misgendering. This includes deadnaming or persistently using a\npronoun that does not correctly reflect a person\u0026rsquo;s gender identity. You must\naddress people by the name they give you when not addressing them by their\nusername or handle\u003c/li\u003e\n\u003cli\u003ePhysical contact and simulated physical contact (eg, textual descriptions\nlike “hug” or “backrub”) without consent or after a request to stop\u003c/li\u003e\n\u003cli\u003eThreats of violence, both physical and psychological\u003c/li\u003e\n\u003cli\u003eIncitement of violence towards any individual, including encouraging a\nperson to commit suicide or to engage in self-harm\u003c/li\u003e\n\u003cli\u003eDeliberate intimidation\u003c/li\u003e\n\u003cli\u003eStalking or following\u003c/li\u003e\n\u003cli\u003eHarassing photography or recording, including logging online activity for\nharassment purposes\u003c/li\u003e\n\u003cli\u003eSustained disruption of discussion\u003c/li\u003e\n\u003cli\u003eUnwelcome sexual attention, including gratuitous or off-topic sexual images\nor behaviour\u003c/li\u003e\n\u003cli\u003ePattern of inappropriate social contact, such as requesting/assuming\ninappropriate levels of intimacy with others\u003c/li\u003e\n\u003cli\u003eContinued one-on-one communication after requests to cease\u003c/li\u003e\n\u003cli\u003eDeliberate “outing” of any aspect of a person’s identity without their\nconsent except as necessary to protect others from intentional abuse\u003c/li\u003e\n\u003cli\u003ePublication of non-harassing private communication\u003c/li\u003e\n\u003c/ul\u003e\n\u003cp\u003eWe will not act on complaints regarding:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003eGood faith and non-malicious conduct whose object is to ameliorate the\nconditions of disadvantaged individuals or groups including those that are\ndisadvantaged because of race, national or ethnic origin, colour, religion,\nsex, age or mental or physical disability.\u003c/li\u003e\n\u003cli\u003eReasonable communication of boundaries, such as “leave me alone,” “go away,”\nor “I\u0026rsquo;m not discussing this with you”\u003c/li\u003e\n\u003cli\u003eRefusal to explain or debate social justice concepts\u003c/li\u003e\n\u003cli\u003eCommunicating in a ‘tone’ you don\u0026rsquo;t find congenial\u003c/li\u003e\n\u003cli\u003eCriticizing racist, sexist, cissexist, or otherwise oppressive behaviour or\nassumptions\u003c/li\u003e\n\u003c/ul\u003e\n\u003cp\u003eWe do not want:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003eOff-Topic conversations in any matrix room other than the \u0026ldquo;Offtopic\u0026rdquo; room\n\u003ccode\u003e#python-off-topic:matrix.org\u003c/code\u003e\u003c/li\u003e\n\u003cli\u003eAdvertising of any kind, except for the presentation of own Python projects.\nHowever, the presentation offer is only for those, who have already\ncontributed to the community. In addition, each project may be presented\nonly once, and only in the \u0026ldquo;Offtopic\u0026rdquo; room \u003ccode\u003e#python-off-topic:matrix.org\u003c/code\u003e.\nThe moderation team reserves the right to reject or delete project\npresentations without giving any reason.\u003c/li\u003e\n\u003cli\u003eJob search or job offers\u003c/li\u003e\n\u003cli\u003eIllegal content\u003c/li\u003e\n\u003cli\u003eSexual content\u003c/li\u003e\n\u003cli\u003eCopyright infringement\u003c/li\u003e\n\u003cli\u003ePaid or unpaid jobs. We are not a freelance service marketplace\u003c/li\u003e\n\u003cli\u003eMoney transactions\u003c/li\u003e\n\u003cli\u003eConversations in other languages than English. We have agreed on English as\ncommon language\u003c/li\u003e\n\u003cli\u003eImages or screenshots of code or error messages. Please use Markdown code\nblocks or spans as described in the \u003ca href="https://matrix-python.github.io/docs/tutorial/formatting/"\u003eTutorial →\u003c/a\u003e\u003c/li\u003e\n\u003c/ul\u003e\n\u003ch2 id="diversity-statement"\u003eDiversity Statement\u003c/h2\u003e\n\u003cp\u003eWe encourage everyone to participate and are committed to building a community\nfor all. Although we will fail at times, we seek to treat everyone both as\nfairly and equally as possible. Whenever a participant has made a mistake, we\nexpect them to take responsibility for it. If someone has been harmed or\noffended, it is our responsibility to listen carefully and respectfully, and do\nour best to right the wrong.\u003c/p\u003e\n\u003cp\u003eAlthough this list cannot be exhaustive, we explicitly honour diversity in age,\ngender, gender identity or expression, culture, ethnicity, language, national\norigin, political beliefs, profession, race, religion, sexual orientation,\nsocioeconomic status, and technical ability. We will not tolerate\ndiscrimination based on any of the protected characteristics above, including\nparticipants with disabilities.\u003c/p\u003e\n\u003cp\u003eThe Python Community \u003ccode\u003e#python-community:matrix.org\u003c/code\u003e takes a position on\nacceptable behaviour for its community as defined by the CoC, and we will not\nendorse behaviour which is counter to that.\u003c/p\u003e\n\u003ch2 id="reporting-issues"\u003eReporting Issues\u003c/h2\u003e\n\u003cp\u003eIf you experience or witness unacceptable behaviour — or have any other\nconcerns — please report it by contacting us via email\n\u003ca href="mailto://abuse@michaelsasser.org"\u003eabuse@michaelsasser.org\u003c/a\u003e or in Matrix:\u003c/p\u003e\n\u003ctable\u003e\n\u003cthead\u003e\n\u003ctr\u003e\n\u003cth\u003eName\u003c/th\u003e\n\u003cth\u003eMatrix Username\u003c/th\u003e\n\u003c/tr\u003e\n\u003c/thead\u003e\n\u003ctbody\u003e\n\u003ctr\u003e\n\u003ctd\u003eBrenBarn\u003c/td\u003e\n\u003ctd\u003e\u003ca href="https://app.element.io/#/user/@brenbarn:matrix.org"\u003e@brenbarn:matrix.org\u003c/a\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eilex\u003c/td\u003e\n\u003ctd\u003e\u003ca href="https://app.element.io/#/user/@ilex:oakforest.in"\u003e@ilex:oakforest.in\u003c/a\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eJames Belchamber\u003c/td\u003e\n\u003ctd\u003e\u003ca href="https://app.element.io/#/user/@jamesbelchamber:matrix.org"\u003e@jamesbelchamber:matrix.org\u003c/a\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eMichael Sasser\u003c/td\u003e\n\u003ctd\u003e\u003ca href="https://app.element.io/#/user/@michael:michaelsasser.org"\u003e@michael:michaelsasser.org\u003c/a\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003c/tbody\u003e\n\u003c/table\u003e\n\u003cp\u003eAll reports will be handled with discretion. In your report please include:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003eYour contact information.\u003c/li\u003e\n\u003cli\u003eNames (usernames and nicks, real names, and/or pseudonyms) of any\nindividuals involved. If there are additional witnesses, please include them\nas well. Your account of what occurred, and if you believe the incident is\nongoing.\u003c/li\u003e\n\u003cli\u003eThe date and time of the incident (or start of incident).\u003c/li\u003e\n\u003cli\u003eAny additional information that may be helpful.\u003c/li\u003e\n\u003c/ul\u003e\n\u003cp\u003eAfter filing a report, a representative will contact you personally, review the\nincident, follow up with any additional questions, and make a decision as to\nhow to respond. If the person who is harassing you is part of the response\nteam, they will recuse themselves from handling your incident. If the complaint\noriginates from a member of the response team, it will be handled by a\ndifferent member of the response team. We will respect confidentiality requests\nfor the purpose of protecting victims of abuse.\u003c/p\u003e\n\u003ch2 id="attribution--acknowledgements"\u003eAttribution \u0026amp; Acknowledgements\u003c/h2\u003e\n\u003cp\u003eThis Code of Conduct is based on the\n\u003ca href="https://matrix.org/legal/code-of-conduct"\u003eMatrix.org\u003c/a\u003e\u0026rsquo;s Code of Conduct, but\nwith some modifications, which is based on the\n\u003ca href="https://twitter.com/todogroup"\u003eTODO Group\u003c/a\u003e\u0026rsquo;s\n\u003ca href="https://github.com/todogroup/opencodeofconduct"\u003eOpen Code of Conduct template\u003c/a\u003e,\nbut with some modifications.\u003c/p\u003e\n'}).add({id:3,href:"/docs/contributing/contribute_to_the_website/",title:"Contribute to the Website",description:"Contribute to our communtiy or improve documentation.",content:'\u003cdiv class="alert alert-warning d-flex" role="alert"\u003e\r\n  \u003cdiv class="flex-shrink-1 alert-icon"\u003e⚠ \u003c/div\u003e\r\n  \r\n    \u003cdiv class="w-100"\u003eMake sure to read the \u003ca href="/docs/contributing/coc/"\u003eCode of Conduct\u003c/a\u003e first. \u003c/div\u003e\r\n  \r\n\u003c/div\u003e\r\n\n\u003ch2 id="create-an-issue"\u003eCreate an issue\u003c/h2\u003e\n\u003cul\u003e\n\u003cli\u003e\u003ca href="https://github.com/matrix-python/matrix-python.github.io/issues/new?template=bug-report---.md"\u003eBug report\u003c/a\u003e\u003c/li\u003e\n\u003cli\u003e\u003ca href="https://github.com/matrix-python/matrix-python.github.io/issues/new?template=feature-request---.md"\u003eFeature request\u003c/a\u003e\u003c/li\u003e\n\u003c/ul\u003e\n\u003ch2 id="contribute-to-the-website"\u003eContribute to the website\u003c/h2\u003e\n\u003cp\u003eYou will find the code of this website on GitHub:\u003c/p\u003e\n\u003cdiv class="alert alert-warning d-flex" role="alert"\u003e\r\n  \u003cdiv class="flex-shrink-1 alert-icon"\u003eGitHub \u003c/div\u003e\r\n  \r\n    \u003cdiv class="w-100"\u003e\u003ca href="https://github.com/matrix-python/matrix-python.github.io"\u003ehttps://github.com/matrix-python/matrix-python.github.io\u003c/a\u003e \u003c/div\u003e\r\n  \r\n\u003c/div\u003e\r\n\n\u003cp\u003eThe repository has two branches with infinite lifetime:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003eThe \u003ca href="https://github.com/matrix-python/matrix-python.github.io/tree/master"\u003emaster\u003c/a\u003e branch is\nprotected and it gets updated on every release.\u003c/li\u003e\n\u003cli\u003eThe \u003ca href="https://github.com/matrix-python/matrix-python.github.io/tree/develop"\u003edevelop\u003c/a\u003e branch is\nthe default/merging branch.\u003c/li\u003e\n\u003c/ul\u003e\n\u003cp\u003eWhen you are working with the repo make sure to follow the\n\u003ca href="https://guides.github.com/introduction/flow/"\u003eGitHub flow\u003c/a\u003e and the\n\u003ca href="https://www.conventionalcommits.org/en/v1.0.0/"\u003eConventional Commits Specification\u003c/a\u003e.\u003c/p\u003e\n\u003cp\u003eThe website is statically generated by\n\u003ca href="https://docs.github.com/en/actions/learn-github-actions"\u003eGitHub Actions\u003c/a\u003e,\nafter merging a pull-request into the \u003ccode\u003emaster\u003c/code\u003e branch.\u003c/p\u003e\n\u003cp\u003eIt is built with \u003ca href="https://gohugo.io/"\u003eHugo\u003c/a\u003e and based on the lovely template\n\u003ca href="https://getdoks.org/"\u003eDoks\u003c/a\u003e, by\n\u003ca href="https://github.com/h-enk"\u003eHenk \u0026ldquo;h-enk\u0026rdquo; Verlinde\u003c/a\u003e. You will find everything\nyou need in the\n\u003ca href="https://getdoks.org/docs/prologue/introduction/"\u003edocumentation\u003c/a\u003e of the Doks\ntemplate.\u003c/p\u003e\n\u003ch2 id="improve-our-documentation"\u003eImprove our documentation\u003c/h2\u003e\n\u003cp\u003eYou will find our documentation in\n\u003ca href="https://github.com/matrix-python/matrix-python.github.io/tree/master/content/docs"\u003e\u003ccode\u003e./content/docs/\u003c/code\u003e\u003c/a\u003e\nof our repository.\u003c/p\u003e\n\u003c!--vim: set ft=pandoc :--\u003e\n'}).add({id:4,href:"/docs/tutorial/about_this_tutorial/",title:"About this tutorial",description:"",content:'\u003cdiv class="alert alert-warning d-flex" role="alert"\u003e\r\n  \u003cdiv class="flex-shrink-1 alert-icon"\u003e⚠ \u003c/div\u003e\r\n  \r\n    \u003cdiv class="w-100"\u003eComing Soon \u003c/div\u003e\r\n  \r\n\u003c/div\u003e\r\n\n'}).add({id:5,href:"/docs/tutorial/account/",title:"Create an Account",description:"",content:'\u003cdiv class="alert alert-warning d-flex" role="alert"\u003e\r\n  \u003cdiv class="flex-shrink-1 alert-icon"\u003e⚠ \u003c/div\u003e\r\n  \r\n    \u003cdiv class="w-100"\u003eComing Soon \u003c/div\u003e\r\n  \r\n\u003c/div\u003e\r\n\n'}).add({id:6,href:"/docs/tutorial/create_room/",title:"Create a Room",description:"",content:'\u003cdiv class="alert alert-warning d-flex" role="alert"\u003e\r\n  \u003cdiv class="flex-shrink-1 alert-icon"\u003e⚠ \u003c/div\u003e\r\n  \r\n    \u003cdiv class="w-100"\u003eComing Soon \u003c/div\u003e\r\n  \r\n\u003c/div\u003e\r\n\n'}).add({id:7,href:"/docs/tutorial/formatting/",title:"Formatting",description:"",content:'\u003cdiv class="alert alert-warning d-flex" role="alert"\u003e\r\n  \u003cdiv class="flex-shrink-1 alert-icon"\u003e⚠ \u003c/div\u003e\r\n  \r\n    \u003cdiv class="w-100"\u003eComing Soon \u003c/div\u003e\r\n  \r\n\u003c/div\u003e\r\n\n'}).add({id:8,href:"/docs/tutorial/join_the_community/",title:"Join the Community",description:"",content:'\u003cdiv class="alert alert-warning d-flex" role="alert"\u003e\r\n  \u003cdiv class="flex-shrink-1 alert-icon"\u003e⚠ \u003c/div\u003e\r\n  \r\n    \u003cdiv class="w-100"\u003eComing Soon \u003c/div\u003e\r\n  \r\n\u003c/div\u003e\r\n\n'}).add({id:9,href:"/docs/help/how-to-update/",title:"How to update Element",description:"",content:'\u003cp\u003eIf you are using the \u003ccode\u003eelement-web\u003c/code\u003e on \u003ccode\u003ehttps://app.element.io/\u003c/code\u003e or any web\nbased version of Element, you are good to go. You don\u0026rsquo;t need to update\nanything manually. When there is a new version available, Element will notify\nyou. Then you have get the option to switch to the new one.\u003c/p\u003e\n\u003cp\u003eIf you are using \u003ccode\u003eelement-desktop\u003c/code\u003e (The desktop version), you may have to\nupdate Element on your own.\u003c/p\u003e\n\u003cp\u003eIf you are using the App on your smartdevice, you have to update manually.\nTo do that, use the App-Store, you installed Element with.\u003c/p\u003e\n\u003cdiv class="alert alert-warning d-flex" role="alert"\u003e\r\n  \u003cdiv class="flex-shrink-1 alert-icon"\u003e💡 \u003c/div\u003e\r\n  \r\n    \u003cdiv class="w-100"\u003eLearn more about \u003ca href="https://element.io/get-started"\u003eElement\u003c/a\u003e. \u003c/div\u003e\r\n  \r\n\u003c/div\u003e\r\n\n'}).add({id:10,href:"/docs/help/troubleshooting/",title:"Troubleshooting",description:"Solutions to common problems.",content:'\u003ch2 id="unable-to-join-the-community-space"\u003eUnable to join the community Space?\u003c/h2\u003e\n\u003cp\u003eYou can only join the Space with a compatible client and homeserver.\nSince Spaces are a brand-new feature, only the newest versions of the Element\nclient are supporting them. Same with the homeservers Synapse and Dendrite.\u003c/p\u003e\n\u003cp\u003eIf you are using older versions or different clients, you are currently not able\nto join the Space. Nevertheless, you can join the rooms manually. You will\nfind the room IDs in \u003ca href="https://matrix-python.github.io/docs/prologue/quick-start/"\u003eQuick Start →\u003c/a\u003e\u003c/p\u003e\n'}).add({id:11,href:"/docs/help/faq/",title:"FAQ",description:"Answers to frequently asked questions.",content:'\u003ch2 id="q-which-language-has-the-community-agreed-on"\u003eQ: Which language has the Community agreed on?\u003c/h2\u003e\n\u003cp\u003eEnglish.\u003c/p\u003e\n\u003ch2 id="q-do-i-need-to-join-the-community-space"\u003eQ: Do I need to join the community Space?\u003c/h2\u003e\n\u003cp\u003eNo, this is an optional feature.\u003c/p\u003e\n\u003ch2 id="q-why-are-the-rooms-not-bridged-to-liberachat-irc"\u003eQ: Why are the rooms not bridged to libera.chat (IRC)?\u003c/h2\u003e\n\u003cp\u003eWe get asked quite a lot about bridging to libera. The bridge is not and was\nnever stable. There are a bunch of  stability and moderation problems. One of\nour biggest critic points of the #python (IRC) is the need to be a to write\nsomething. It is not that big of a problem, when you used an IRC before, and\nyou know how it works. When you don\u0026rsquo;t, you need to look it up. Then you need\nto find out how you do that via appbridge/heisenbridge. There is no GUI to do\nthat. That is a bad user experience we don\u0026rsquo;t want.\u003c/p\u003e\n\u003cp\u003eIn this room, it should be easy to join and chat. We are not interested in\nscaring away users because of the complexity.\u003c/p\u003e\n\u003cp\u003eIf you want to join \u003ccode\u003e#python\u003c/code\u003e on libera.chat , you can use the usual tools to\ndo so, or you select \u0026ldquo;Matrix\u0026rdquo; in \u0026ldquo;libera.chat\u0026rdquo; when you click on \u0026ldquo;explore\nrooms\u0026rdquo;. If you are not on matrix.org, you can add that server.\u003c/p\u003e\n\u003cp\u003e\u003cstrong\u003eTL;DR\u003c/strong\u003e\u003c/p\u003e\n\u003cp\u003eNo, we are not planning to bridge this room.\u003c/p\u003e\n\u003ch2 id="q-what-does-a-moderator-do"\u003eQ: What does a moderator do?\u003c/h2\u003e\n\u003cp\u003eA moderator in Matrix is a person given special authority to enforce the rules on a room.\u003c/p\u003e\n\u003ch2 id="q-how-do-i-become-a-moderator"\u003eQ: How do I become a moderator?\u003c/h2\u003e\n\u003cp\u003eIn our community it\u0026rsquo;s like the American band\n\u003ca href="https://en.wikipedia.org/wiki/Sugarloaf_(band)"\u003eSugarloaf\u003c/a\u003e sung:\u003c/p\u003e\n\u003cblockquote\u003e\n\u003cp\u003e\u003cem\u003eDon\u0026rsquo;t call us, We\u0026rsquo;ll call you.\u003c/em\u003e\u003c/p\u003e\n\u003c/blockquote\u003e\n\u003cp\u003eWe don\u0026rsquo;t have a form to apply. We keep our eyes and ears open for users, who\nare active in the community, willing to help other users, with \u003cstrong\u003euseful\u003c/strong\u003e\ninformation and know how to be compliant with our\n\u003ca href="https://matrix-python.github.io/docs/contributing/code_of_conduct/"\u003eCode of Conduct\u003c/a\u003e.\u003c/p\u003e\n\u003cp\u003eIf we are interested in you to becoming a moderator, we will contact you.\u003c/p\u003e\n'}).add({id:12,href:"/docs/contributing/",title:"Code of Conduct",description:"Our Code of Conduct.",content:""}).add({id:13,href:"/docs/help/",title:"Help",description:"Help Doks.",content:""}).add({id:14,href:"/docs/tutorial/",title:"Tutorial",description:"Tutorial",content:""}).add({id:15,href:"/docs/prologue/",title:"Prologue",description:"Prologue Doks.",content:""}).add({id:16,href:"/docs/",title:"Docs",description:"Docs Doks.",content:""}),search.addEventListener('input',b,!0),suggestions.addEventListener('click',c,!0);function b(){var d,e;const c=5;d=this.value,e=a.search(d,{limit:c,enrich:!0}),suggestions.classList.remove('d-none'),suggestions.innerHTML="";const b={};e.forEach(a=>{a.result.forEach(a=>{b[a.doc.href]=a.doc})});for(const d in b){const e=b[d],a=document.createElement('div');if(a.innerHTML='<a href><span></span><span></span></a>',a.querySelector('a').href=d,a.querySelector('span:first-child').textContent=e.title,a.querySelector('span:nth-child(2)').textContent=e.description,suggestions.appendChild(a),suggestions.childElementCount==c)break}}function c(){while(suggestions.lastChild)suggestions.removeChild(suggestions.lastChild);return!1}})()